import React, { Component }  from 'react';
import TextField from 'material-ui/TextField';
import RaisedButton from 'material-ui/RaisedButton';

import darkBaseTheme from 'material-ui/styles/baseThemes/lightBaseTheme';
import MuiThemeProvider from 'material-ui/styles/MuiThemeProvider';
import getMuiTheme from 'material-ui/styles/getMuiTheme';

const Config = ({
  //actions
  setFirebaseConfig
}) => {
  let apiKey, databaseURL;
  return (
    <div style={{display: 'flex', flexDirection: 'column', justifyContent: 'center', alignItems: 'center'}}>
      <div>
        <p>Введите <span style={{fontWeight: 'bold'}}>apiKey</span> и  <span style={{fontWeight: 'bold'}}>databaseURL</span> своего приложения firebase и нажмите на кнопку Установить</p>
      </div>
      <div>
        <p>Для доступа к демо используйте <span style={{fontWeight: 'bold'}}>apiKey</span> <span style={{color: 'goldenrod'}}>AIzaSyBzPxu9Yt_kPLReqaN3J3tpLJK3OJky_gI</span> и <span style={{fontWeight: 'bold'}}>databaseURL</span> <span style={{color: 'goldenrod'}}>https://quick-order-de84c.firebaseio.com</span></p>
      </div>
      <div>
        <TextField 
          placeholder='apiKey'
          id='apiKey'
          ref={
            (node)=>{
              apiKey = node;
            }
          }
          style={{width: '400px'}}
          onTouchTap={
            ()=> {
              //console.log('touch tap');
            }
          }
        />
      </div>
      <div>
        <TextField 
          placeholder='databaseURL'
          id='databaseURL'
          ref={
            (node)=>{
              databaseURL = node;
            }
          }
          style={{width: '400px'}}
        />
      </div>
      <div>
        <RaisedButton 
          label='Установить'
          onClick={
            () => {
              const apiKeyVal = apiKey.input.value.trim();
              const databaseURLVal = databaseURL.input.value.trim();
              let ok = true;
              if (!apiKeyVal) {
                alert('Не задан apiKey');
                ok = false;
              }
              if (!databaseURLVal && ok) {
                alert('Не задан databaseURL');
                ok = false;
              }
              const firebaseConfig = {
            		apiKey: apiKeyVal,
                databaseURL: databaseURLVal,
            	};
            	if (ok) {
                localStorage.setItem('firebaseConfig', JSON.stringify(firebaseConfig));
                location.reload();
            	}
              
            }
          }
        />
      </div>
      <div>
        <p>Где найти <span style={{fontWeight: 'bold'}}>apiKey</span> и  <span style={{fontWeight: 'bold'}}>databaseURL?</span></p>
        <p>
          Зайдите на страницу своего проекта, затем нажмите на кнопку настройки (иконка с шестеренкой), выберите "Настройки проекта". 
          <br></br>
          На странице настроек кликните по иконке "Добавьте firebase в свое приложение"
          <br></br>
          В открывшемся окне вы увидите <span style={{fontWeight: 'bold'}}>apiKey</span> и  <span style={{fontWeight: 'bold'}}>databaseURL</span>
          <br></br>
          Введите их в соответствующие поля на данной форме
        </p>
      </div>
      <div style={{marginTop: '30px'}}>
        <img alt='Поясняющая картинка' src='data:image/png;base64,' />
      </div>
    </div>  
  );
};

export default class firebaseConfigWrapper extends Component {
  
  render() {
    return (
      <MuiThemeProvider muiTheme={getMuiTheme(darkBaseTheme)}>
        <Config />
      </MuiThemeProvider>
    );
  }
  
}
